import React, { Component } from 'react';

class AllVideos extends Component {
    constructor(props) {
        super(props)
        this.state = {

        }
    }

    render() {
        const { data } = this.props;
        console.log(data);
        return (
            <div>
            {data.series.videos.map((video, i) => (
                <div className="card card-block videoCard" key={video.id}>
                    <img
                        className="card-img-top"
                        src={video.thumb}
                        alt="noImage" />

                    <div className="card-body p-2">
                        <span className='video-match-title'>
                            {video.video.match_obj.title}
                        </span><br />

                        <span className='video-title'>
                            {video.video.title}
                        </span>
                    </div>
                </div>
            ))}
        </div>
        )
    }
}
export default AllVideos;
